partner Pro-Change Behavior Systems. The HRA is available online, in English and Spanish. A print-based version of the assessment is available, if needed. Personal feedback can be viewed on-screen or through a printed report. Insert NCQA logo here.\n\nValidated Readiness to Change Assessment \nUnlike other health risk assessments, ours uses validated questions to assess readiness to change leading health risks and provides immediate feedback on the most important behavior change strategies based on empirically derived decision rules.\n\nEvidence-based Personal Feedback Report \nOur personal feedback report provides evidence-based, stage-matched feedback about the single most important strategy individuals can use to make progress on that specific behavior.\nEach time a user completes the survey, their feedback is updated to reflect change since the previous assessment. The report suggests online and community resources through which participants can learn more.\u00a0Our assessment provides an overall Personal Health Report\u00a0participants can share with their health care provider.\n\nHRA Features\n In addition to health risks such as smoking, unhealthy eating, sedentary behavior, depression, and ineffective stress management, our evidence-based Survey also assesses:\n\u2022 Current health conditions\n\u2022 Adherence to United States Preventive Services Task Force recommendations for age and gender appropriate screenings and immunizations\n\u2022 Productivity and well-being\n\n", "category": "Programs & Services", "embedding": [0.03185507212811456, 0.4232793463062684, 0.5483066458390391, 0.9487033848959997, 0.9853736355387775, 0.41362245262075215, 0.8219313717513459, 0.1379055290415211, 0.9302558960742235, 0.800494122572181, 0.5232132275172158, 0.0952516190115158, 0.7471004294880252, 0.2657176490487252, 0.505288436957098, 0.32040794558743546, 0.7245151739144903, 0.007284551433923148, 0.1584986267629227, 0.18699142740504782, 0.16105472901296403, 0.5581055655230915,  our Patient Satisfaction policy and procedure, it is HMC\u2019s policy to have a clear understanding of client satisfaction with programs, services and personnel, and to implement changes designed to increase satisfaction when appropriate. Below is a summary of the procedure we follow:\n1) Account Management Reports\na) Bi-annual Account Management Report\ni) Twice per year, Account Managers complete a report for each of their clients that includes satisfaction\nratings as well as narrative regarding particular barriers and successes.\nii) The Account Management reports are sent to the Vice President of Quality Management.\nb) Weekly Account Management Reports\ni) On a weekly basis, the Account Managers prepare a report on client activity.\nii) The Vice President of Quality Management is included in the distribution list for these weekly reports.\n2) Reporting to the Quality Management Committee (QMC)\na) The Director of Quality Management receives the information noted above and produces a bi-annual summary\nthat is documented on the QMC Performance Monitoring report.\nb) The summary report is presented to the QMC by the Vice President of Quality Management.\nc) Based on the review and recommendations of the QMC:\ni) Corrective Action Plans (CAP) will be initiated when needed to address areas of concern.\nii) If indicated, the application of a formal quality improvement project (QIP) will be applied.", "category": "Providers & Clinical Services", "embedding": [0.254114147509517, 0.6901918596483276, 0.3802343962030934, 0.23330373440999996, 0.15511336686171961, 0.6277214815643858, 0.7409183321029875, 0.8319355817815073, 0.16668168387097837, 0.3437958579478312, 0.21625657867904413, 0.5263745488039567, 0.9192885726479596, 0.43092603806814445, 0.9377460318179698, 0.22279875124284765, 0.5205630655948199, 0.7290141739640472, 0.4926901987840743, 0.6188390288875623, 0.831656422940251, 0.44460909261222203, 0.9562368924787271, 0.25143133169386234, 0.092172620679012, 0.640980 2)\u00a0\u00a0\u00a0Welcome the participant and share the name of the program and where you are calling from (HMC HealthWorks).\n\u2022 Provide participant with an explanation of how/why they are eligible for program participation. Include client specific incentive or disincentive information if applicable.\u00a0\u00a0\n\u2022 Provide verbal program overview.\u00a0\n\u2022 Upon request, email or mail document to participant.\n3)\u00a0\u00a0\u00a0Provide reason for the call including length of call and expectations.\u00a0\nInclude the following:\n\u2022 The objective of the program is to support individuals in making healthy lifestyle changes.\n\u2022 Through active participation in the program, participants can improve health outcomes.\n\u2022 There is no cost to participate.\n\u2022 PHI (personal health information) is kept according to HIPAA standards.\n\u2022 The program is confidential.\u00a0 Individual health information is not shared with the union or employer. This information is only available to the fund or third-party administrator (TPA) who has access to consumer health information in order to receive and pay claims for services rendered.\n\u2022 Confidentiality is extended to the HMC HealthWorks' team of coaches including Nurse Health Advocates, wellness coaches, psychologists, psychiatrist, and the medical director. Consultation within the team occurs as situations outside the realm of expertise of the coach arise.\n\u2022 Confidentiality is limited if there is mention of harm to self, others or abuse.\u00a0\n\u2022 Coaching calls are periodically randomly monitored or recorded for quality purposes and training.\n\u2022 Participants have the right to discontinue, change coaches, or register a complaint at any time by calling HMC HealthWorks' toll free number (provide participant with the client specific toll free number) .\n\u2022 Details of participant rights and responsibilities can be emailed or mailed if requested by participant.\n\u2022 Ask participant if there are any questions before moving forward with the session.\n4)\u00a0\u00a0\u00a0Begin or continue with assessment, development/implementation of care plan goals and interventions.\n5)\u00a0\u00a0\u00a0Answer questions the participant may have.\u00a0\n6)\u00a0\u00a0\u00a0Provide reference information related to topic discussed during the call\n7)\u00a0\u00a0\u00a0Schedule next call", "category": "General / Miscellaneous", "embedding": [0.9353486757832669, 0.21384573789608774, 0.217321970918549, 0.5214770764785762, 0.16592107325830763, 0.2339873657251459, 0.5009238522697179, 0.38611290173164614, 0.4507592329586234, 0.15592190156935304, 0.24643617847653554, 0.5126494594594854, 0.010146660879595815, 0.3942966621542924, 0.7139312245164977, 0.4047115566467372, 0.946345047494166, 0.7440448617900135, 0.5064122994933857, 0.5712256155382669, 0.12229930658575006, 0.8923849873383801, 0.41964671033979184, 0.21215901834237916, 0.7434305798794879, 0.8925038377063774, 0.9159031153184266, 0.5710529213715027, 0.9330858555873364, 0.11190638561584454, 0.5262246086261735, 0.7521556301954688, 0.39461007742863907, 0.46550987405745303, 0.4139169279860795, 0.44673183080925394, 0.9001527720591034, 0.7510722976577486, 0.7623297735655721, 0.9539126627386544, 0.07973653002337822, 0.02446351560074811, 0.01510506172133419, 0.07106004320905157, 0.20443780372481557, 0.8026559704974147, 0.02907439393882094, 0.44634205407574223, 0.9612150557875411, 0.7332838539681032, 0.28367180093907063, 0.1748252610211517, 0.8769397526353194, 0.052735187875724066, 0.544180431276977, 0.47972628098331693, 0.28506165122077576, 0.6276096633539264, 0.9845829709573695, 0.45687982286301143, 0.9124752981013103, 0.36153862133448866, 0.03705339384330453, 0.2285591244939984, 0.83284491446445, 0.7910471456952484, 0.35159797642100554, 0.2712412136206733, 0.24136937957810523, 0.3339097122666972, 0.30978981582877685, 0.09071793710906528, 0.3350744928666094, 0.8332066693121856, 0.35727162844220595, 0.6647040781948117,     let searchInput = document.getElementById("searchBox");
    let resultsDiv = document.getElementById("results");

    function fakeEmbed(text) {
      let seed = Math.abs(Array.from(text).reduce((a, c) => a + c.charCodeAt(0), 0)) % 10000;
      return Array(1536).fill(0).map((_, i) => Math.sin(seed * (i + 1)) % 1);
    }

    function cosineSimilarity(a, b) {
      let dot = 0, normA = 0, normB = 0;
      for (let i = 0; i < a.length; i++) {
        dot += a[i] * b[i];
        normA += a[i] ** 2;
        normB += b[i] ** 2;
      }
      return dot / (Math.sqrt(normA) * Math.sqrt(normB));
    }

    function search(query) {
      let queryVec = fakeEmbed(query);
      return data.map(entry => {
        return {
          ...entry,
          score: cosineSimilarity(queryVec, entry.embedding)
        };
      }).sort((a, b) => b.score - a.score).slice(0, 5);
    }

    searchInput.addEventListener("input", () => {
      let query = searchInput.value.trim();
      resultsDiv.innerHTML = "";
      if (!query) return;

      let results = search(query);
      resultsDiv.innerHTML = results.map(r => `
        <div class="result">
          <h4>Q: ${r.question}</h4>
          <p><strong>Answer:</strong> ${r.answer}</p>
          <p><small><em>Score: ${r.score.toFixed(3)}</em></small></p>
        </div>
      `).join("");
    });
